%[text] # Unit 1 Review
%[text] 
%[text] ## Main Skills 
%[text] 1. Variable assignment and function calling
%[text] 2. Plotting
%[text] 3. Loading Tables and accessing contents from tables
%[text] 4. Opening Images
%[text] 5. Enhancing Contrast and Preprocessing Images
%[text] 6. Segmentation
%[text] 7. Region Properties
