%%
%[text] ## Plot a Line
%[text] Plot a line from x,y coordinates (10,20) to  (100, 110)
%[text] ```matlabCodeExample
%[text] plot(X,Y)
%[text] ```
mmfig; %[output:213f7bb9] %[output:6022e85b]
plot([10 100], [20 110]) %[output:6022e85b]
%%
%[text] Add a third point at 150, 60
hp = plot([10 100 150], [20 110 60],'b--*') %[output:34f4ee00] %[output:74d755ee]
%%
%[text] Jazz up the line (review documentation)
%[text] - red, dotted
%[text] - black, dashed
%[text] - add an asterisk marker \
hp = plot([10 100 150], [20 110 60], LineStyle='--') %[output:82bf3f41] %[output:816db5fa]
%%
%[text] Jazz up the axes
%[text] - add a title
%[text] - add a subtitle
%[text] - add a xlabel
%[text] - add a ylabel \
title('My Title','My Subtitle') %[output:9ecbfbb0]
%%
c = 0.95 %[output:1aea7181]
title('My Title',sprintf('Corr = %1.2f',c)) %[output:6f18d62f]
%%
%[text] Who is the parent?
%[text] Add a handle to the plot 

%[text] - review the properties: Marker, color, etc. \
%%
%[text] Use the handle to change properties of the axes, like font size

%[text] 
%%
%[text] ## Tables
%[text] 1. Create a file path the 'Brain Size Data.xls' file in the data folder
%[text] 2. Read in the table \
filepath = "/Users/ernesto/MATLAB-Drive/ANAT6205/UNIT 1/data/Brain Size Data.xls" %[control:filebrowser:0369]{"position":[12,82]} %[output:1dee91d4]
%%
T = readtable(filepath) %[output:2337be59]
%%
%[text] ### Properties
%[text] Change the Name of the Gender column to 'Sex'
T.Properties.VariableNames{1} = 'Sex' %[output:1d4891f3]
%%
%[text] Typecast the Sex column to a categorical array
T.Sex = categorical(T.Sex) %[output:56b37281]
%%
T.Sex %[output:9de8780f]

%%
%[text] ### Visualization
%[text] Plot a histogram of the FSIQ with 10 bins. 
mmfig %[output:884fd90d] %[output:8f17ed09]
histogram(T.FSIQ,10) %[output:8f17ed09]
%%
%[text] Overlay histograms: male vs female MRI\_Count
clf %[output:692419e1]
la = T.Sex == "Male";
x = T.MRI_Count(la);
histogram(x) %[output:692419e1]
hold on %[output:692419e1]
% la = T.Sex == "Female";
x = T.MRI_Count(~la);
histogram(x) %[output:692419e1]
%%
%[text] #### Using a new Function
%[text] Use **gscatter** to Plot Height vs MRI\_Count and use sex as a grouping variable.
%[text] Pro-tip: Assign the data to ***x, y,*** and ***g*** before plotting (keeps the code simpler)
x = T.Height;
y = T.MRI_Count;
g = T.Sex;

figure(Visible="on"); %[output:6fe537c7]
gscatter(x,y,g) %[output:6fe537c7]
%%
%[text] - Add Equality Line \

%%
%[text] - Add Regression Line \
hold on %[output:2aa3ddf9]
la = isnan(x);
x(la) =[];
y(la) = [];

hold on %[output:2aa3ddf9]

p = polyfit(x,y,1); % returns slope and intercept
f = polyval(p,x); % calculate the y's from x using p
plot(x,f,'k-',"LineWidth",1,"DisplayName","Best Fit Line") % plot the regression line %[output:2aa3ddf9]
%%
%[text] - Discretize FSIQ to create a categorical arrays with 2 categories: High and Normal. 
%[text] - Add a new column IQ \

%[text] 
%%
%[text] ## Which is the complement? Which has the LUT inverted?
%[text] ![](text:image:60fc)
%[text] Which Image (Image 1 vs Image 2) is the complement and which image has its look-up table inverted?
%%
%[text] ## Dot Blot
%[text] The dot blot image can also be found in the Unit 1 data folder
%[text] - Change the current folder to the data folder
%[text] - Read in the image as ***img***.  \
close all
clearvars
img = imread("Dot_Blot.png");
%%
figure(visible="on") %[output:155ae115]
imshow(img) %[output:155ae115]
%%
%[text] ### Preprocessing steps: Complement
%[text] - Create a structure to organize the preprocessing steps
%[text] - Create a complement of the image and assign to p.complement \
p.complement = imcomplement(img);
%%
%[text] ### Filtering the image.
%[text] Follow the money
p.median = medfilt2(p.complement,[7 7]);
p.gauss = imgaussfilt(p.median,2);
p.adapt = adapthisteq(p.gauss);
%%
mmShowStruct(p) %[output:7ac9f08a]
%%
%[text] Programmatically accessing fields in a structure
%[text] - type p.( \
imshow(p.("complement")) %[output:4d815ce4]
%[text] - you can name the field name if you use the above syntax \
%%
%[text] Package all of the fieldnames into a cell array
fn = fieldnames(p) %[output:734904b9]
%%
fn{1} % curly bracket indexing since its a cell array %[output:9eae5cbc]
%%
clf %[output:069aa4b2]
imshow(p.(fn{1})) %[output:069aa4b2]
%%
edit mmShowStruct.m
%%
%[text] ### Segment and Cleanup
p.binarize = imbinarize(p.adapt,'adaptive'); % notice the 'adaptive' addon here
p.border = imclearborder(p.binarize); % only works on binary images
p.clean = bwareaopen(p.border,30);
%%
mmShowStruct(p) %[output:99c362c5]
%%
%[text] ### Region Properties
mask = p.clean;
rp = regionprops('table',mask,'basic') % returns a table %[output:24586d6c]
%[text] - each row represents one dot in the dot blot
%[text] - since we didn't include the image, we don't get the mean intensity (we will do that in a bit \
%%
%[text] #### Labeling Images
%[text] Get the X,Y coordinates of the first dot
x = rp.Centroid(1,1) %[output:29949504]
y = rp.Centroid(1,2) %[output:8fb92ec8]
%%
%[text] Display the image and add an x to the first dot. In cyan
clf %[output:9d3b5032]
imshow(img) %[output:9d3b5032]
text(x,y,'x','Color','m','FontSize',18,'HorizontalAlignment','center','VerticalAlignment','middle') %[output:9d3b5032]
%%
%[text] Add an asterisk to the last dot, In magenta
x = rp.Centroid(end,1) %[output:40ae74fb]
y = rp.Centroid(end,2) %[output:6499d17d]
text(x,y,'*',Color='m') %[output:136c9a3d]
%%
text(25,25,'Ernesto',Color='cyan') %[output:190c1d67]
%%
%[text] Use a for loop to letter the dots in alphanumeric order
az = ['a':'z' 'A':'B'] % there's more dots than letters %[output:557708f0]
clf %[output:4e4f3511]
imshow(img) %[output:4e4f3511]
for n=1:height(rp) %[output:group:89978dfd]
    x = rp.Centroid(n,1);
    y = rp.Centroid(n,2);
    text(x,y,az(n),Color='m') %[output:4e4f3511]
end %[output:group:89978dfd]
%%
%[text] Sort ***rp*** by area size and then re-run the FOR LOOP above
rp = sortrows(rp,"Area") %[output:6429587c]
%%
%[text] ### Get Intensity Properties of the Image
rp = regionprops('table',mask,img,{'Area','Centroid','MeanIntensity','BoundingBox'}) % add img and 'MeanIntensity' %[output:9b6c904a]
%%
stats = groupsummary(rp,[],["mean" "std" "median"],["Area" "MeanIntensity"]) %[output:6cc2a188]
%[text] - how do you add std deviation to the calculation? median?
%[text] - how do you get the mean MeanIntensity \
%%
%[text] ### IF ELSE
if true %[output:group:7f36f90f]
    disp('do this') %[output:46788c7c]
else
    disp('do that')
end %[output:group:7f36f90f]
%[text] - change the TRUE to FALSE
%[text] - Add an else statement that displays 'do that' \
%%
%[text] Bouncer Algorithm
age = 12 %[output:6a835738]
if age > 50 %[output:group:6f3eef8f]
        disp("Party on grandpa")
elseif age > 20
        disp("You're good")
else
    disp("Nice try.") %[output:8750182e]
end %[output:group:6f3eef8f]
%[text] - if Greater than 20, display 'You're good.'
%[text] - Otherwise display 'Nice Try' \
%%
%[text] 
rp = sortrows(rp,"MeanIntensity");
prct75 = prctile(rp.MeanIntensity,75);
imshow(img) %[output:46f16d81]

for n=1:height(rp) %[output:group:31690030]
    x = rp.Centroid(n,1);
    y = rp.Centroid(n,2);
    text(x,y,num2str(n),Color='m') %[output:46f16d81]

        if rp.MeanIntensity(n) < prct75
                rectangle('Position',rp.BoundingBox(n,:),EdgeColor='cyan')
        end
end %[output:group:31690030]

